syntax = "proto3";

option java_package = "emu.grasscutter.net.proto";
// Version: 5.0

import "DungeonEntryInfo.proto";

message DungeonEntryPointInfo {
    repeated DungeonEntryInfo dungeon_entry_list = 1;
    uint32 point_id = 6;
    uint32 recommend_dungeon_id = 10;
    uint32 scene_id = 12;
}